import React, { Component } from 'react'

export class Bezitting extends Component {
    render() {
        return (
            this.props.items.map((item) => 
            <div key= {item.id} style={{backgroundColor: '#f4f4f4'}}>
                 <p>{item.id}</p>
                 <p>{item.bezitting}</p>
                 <p>{item.waarde}</p>
            </div>
            )
        )
    }
}

export default Bezitting
